import React, { Component } from 'react'
import './App.css'

class App extends Component {
  constructor () {
    super()

    this.state = {
      string: 'Hello Akansha'
    };
  }
  render () {
    return (
      <div className='App'>
        <header className='App-header'>
          <p>{this.state.string}</p>
          <button onClick={()=> this.setState({ string: 'Hello Andrei'})}>ChanGE TEXT </button>
        </header>
      </div>
    );
  }
}

export default App
